import home5 from "../../assets/home5.png";
import classes from "./AddressMap.module.css";

const AddressMap = () => {
  return (
    <div className={classes.homemap}>
      <div className={classes.images}>
        <img src={home5} />
        <h1>Address</h1>
        {/* <p>Ambavadi vas, Kanodar, T.A.-Palanpur, Dist.-Banaskantha, Gujarat - 385520</p> */}
        <p>T.A. -Rajesultanpur, Dist. -Ambedkar Nagar,</p>
        <p>Uttar Pradesh - 224176</p>
      </div>
      {/* <div className={classes.map_}>
        <img src={home5} />
        <p></p>
      </div> */}
    </div>
  );
};

export default AddressMap;
